// src/data/projectsData.js

const projectsData = [
  {
    id: 1,
    title: 'Project One',
    description: 'A brief description of Project One.',
    image: require('../images/project11.png'), // For local images
    // image: 'https://your-image-url.com/project1.jpg', // For external images
    link: 'https://github.com/yourusername/project-one',
    technologies: ['React', 'CSS', 'JavaScript'],
  },
  {
    id: 2,
    title: 'Project Two',
    description: 'A brief description of Project Two.',
    image: require('../images/project2.png'),
    link: 'https://project-two.com',
    technologies: ['Node.js', 'Express', 'MongoDB'],
  },
  {
    id: 3,
    title: 'Project Three',
    description: 'A brief description of Project Three.',
    image: require('../images/project3.png'),
    link: 'https://project-three.com',
    technologies: ['Python', 'Django'],
  },
];

export default projectsData;
